import React from "react";
import { makeStyles } from "@material-ui/core";
const useStyles = makeStyles({
  root: {
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    width: "300px",
    height: "350px",
    background: "transparent",
    border:"1px solid black",
    borderRadius: "10px",
  },
  image:{
      width:"100%",
      height:"50%"
  }
});
const Index = () => {
  const classes = useStyles();
  const dummy = {
    iamge: "https://pbs.twimg.com/media/CV4VEzDXIAIdgXG?format=jpg&name=large",
    name: "john",
    followers: 1002,
    rate: 5,
  };
  return (
      <div className={classes.root}>
          <img src={dummy.iamge} className={classes.image}/>
      </div>
  )
};

export default Index;
